import axios from "axios";

const API_URL = "http://localhost:5000/api/journals";

// Get all journals
export const getJournals = () => {
  return axios.get(API_URL);
};

// Create a new journal
export const createJournal = (journalData) => {
  return axios.post(API_URL, journalData);
};

// Update a journal
export const updateJournal = (id, journalData) => {
  return axios.put(`${API_URL}/${id}`, journalData);
};

// Delete a journal
export const deleteJournal = (id) => {
  return axios.delete(`${API_URL}/${id}`);
};
